import React, { Component } from 'react';
import './index.css'

export default class Items extends Component {
    render() { 
        const {id,name,done} = this.props
        return (
            <li>
                <label>
                    <input type="checkbox" />
                    <span>{done ? name : id}</span>
                </label>
            </li>
        )
    }
}
